import React from "react";
import styled from "styled-components";

const Main = styled.div`
  background: gray;
  height: 100vh;
  width: 100%;
  display: flex;
  flex-direction: column;
  justify-content: space-around;
  align-items: center;
`;

const TitleDiv = styled.div`
  background: green;
  width: 90%;
  height: 15vh;
  display: flex;
  align-items: center;
`;

const Box = styled.div`
  background: #4484CE;
  height: 100%;
  width: 10px;
`;

const Texts = styled.div`
  background: pink;
  width: 60vw;
  height: 90%;
  margin: 20px 0;
`;

const Content = styled.div`
  background: cyan;
  width: 90%;
  height: 60vh;
`;

export default function index(props) {
  return (
    <Main>
      <TitleDiv>
        <Box/>
        <Texts>

        </Texts>
      </TitleDiv>
      <Content></Content>
    </Main>
  );
}
